    Svalinn = "\u0412\u043E \u0432\u0440\u0435\u043C\u044F \u043F\u043E\u0434\u0441\u0447\u0451\u0442\u0430 \u043F\u043E\u0431\u0435\u0434\u043D\u044B\u0445 \u043E\u0447\u043A\u043E\u0432 \u0432 \u043A\u043E\u043D\u0446\u0435 \u044D\u043F\u043E\u0445\u0438 2 \u043F\u0440\u0438\u0431\u0430\u0432\u044C\u0442\u0435 \u043A \u0441\u0432\u043E\u0435\u043C\u0443 \u0438\u0442\u043E\u0433\u043E\u0432\u043E\u043C\u0443 \u043F\u043E\u043A\u0430\u0437\u0430\u0442\u0435\u043B\u044E \u0445\u0440\u0430\u0431\u0440\u043E\u0441\u0442\u0438 5 \u043F\u043E\u0431\u0435\u0434\u043D\u044B\u0445 \u043E\u0447\u043A\u043E\u0432 \u0437\u0430 \u043A\u0430\u0436\u0434\u0443\u044E \u0441\u0432\u043E\u044E \u043A\u0430\u0440\u0442\u0443 \u0433\u0435\u0440\u043E\u044F.",
